/* eslint-disable */

import { Component } from "react";

/*
class Breed extends Component {
  state = {
    type: 0,
  };

  catClick() {
    this.setState({
      type: 1,
    });
  }

  dogClick() {
    this.setState({
      type: 2,
    });
  }

  render() {
    return <h1>{this.state.type}</h1>;
  }
}
*/

function Breed(type) {
  if (type == 1) {
    return <h1>Cat</h1>;
  } else if (type == 2) {
    return <h1>Dog</h1>;
  } else {
    return <h1>Null</h1>;
  }
}

export default Breed;
